import React from "react";

export const ContactPicker = ({contacts, handleChange, name, phone, email}) => {
  return (
    <select name="contact">
    {
    contacts.map((contact) => (
      <option value={contact.name}>{contact.phone}</option>
    ))
    }
    </select>
  );
};
